import React, { FC } from 'react';
import styled from '@emotion/styled';

const Img = styled.img<any>`
  max-height: ${props => props.maxHeight.maxHeight};
`;

interface LogoProps {
  urlImg: string
  maxHeight: string
}

export const Logo: FC<LogoProps> = props => {
  return <Img src={props.urlImg} {...props}/>;
};
